import React from "react";
import "./AboutCard.scss";

export default function AboutCard({talkDetails}) {
  return (
    <div>
      <div className="container">
        <div
          className={
            talkDetails.isDark ? "dark-rectangle rectangle" : "rectangle"
          }
        >
        </div>
      </div>
    </div>
  );
}
